import React, {Component} from 'react';

class RegisterForm extends Component {
    render() {
        
        return (
            <React.Fragment>
                <br/>
                <div className="fontifyr">
                    Hello
                </div>
            </React.Fragment>
        );
    }
}

export default RegisterForm;
